import './App.css';
import React, { useState, useEffect} from 'react';

function App() {
  const [ data, setData ] = useState([]);
  const [ loaded, setLoaded ] = useState(false);

  useEffect(() => {
    fetch("https://htxrockets.com/api/archived-game/0022101142")
    .then( (res) => res.json() )
    .then( (json) => {
      setData(json);
      setLoaded(true);
    });

  }, [])

  return (
    <div className="App">
      <h1>Houston Rockets Box Score</h1>
    </div>
  );
}

export default App;
